import React from "react";

const Search = () => {

    let Search = "";
    return (
        <div>
            <div>
                <input
                    placeholder="¿Qué pokemon quieres conocer?"
                />
            </div>
        <div>
        {Search}
        </div>
        </div>
    )

};

export default Search;
